    false,nt"url": null,nt"notes": "This EnviroAtlas dataset describes the
    block group population and the percentage of the block group population that has
    potential views of water bodies. A potential view of water is defined as having
    a body of water that is greater than 300m2 within 50m of a residential location.
    The window views are considered "potential" because the procedure does not account
    for presence or directionality of windows in one's home. The residential locations
    are defined using the EnviroAtlas Dasymetric (2011/October 2015 version) map. This
    dataset was produced by the US EPA to support research and online mapping activities
    related to EnviroAtlas. EnviroAtlas (https://enviroatlas.epa.gov/EnviroAtlas) allows
    the user to interact with a web-based, easy-to-use, mapping application to view
    and analyze multiple ecosystem services for the contiguous United States. The dataset
    is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas
    ) or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
